angular.module('calendar.templates').run(['$templateCache', function($templateCache) {$templateCache.put('static/app/month/month.directive.html','<p>{{month.name}}</p>\n<ul class="month-days offset-{{month.startDay}}">\n  <li class="month-day"\n      ng-repeat="day in month.days"\n      ng-class="{\'past\': day.isInPast}"\n      ng-click="showDay(day)">\n    {{day.date}} - {{day.weekday}}\n  </li>\n</ul>\n\n<section class="day" ng-show="!!focussedDay">\n  <h2>{{focussedDay.date}}</h2>\n  <input type="text" placeholder="Appointment" ng-model="focussedDay.appointment" />\n  <button ng-click="hideDay()">Close</button>\n  <button ng-click="saveDay(focussedDay)">Save</button>\n</section>\n');
$templateCache.put('static/app/root/root.controller.html','<month></month>');}]);